import styled from "styled-components";

export const Wrapper = styled.div`
  display: block;
  width: 100%;
`;

export const StickerWrapper = styled.div`
  flex-wrap: wrap;
  justify-content: center;

  & > img {
    width: 25%;
  } 


  & > img:hover {
    scale: 105%;
    rotate: var(--rand-img-rotate);
  }
`;
